	    mtc0    $t4, $12


        sub $sp, $sp, 4
        sw $ra 0($sp)

        la  $t0, has_puzzle
        sb  $0, 0($t0)
        la $t0,  puzzle
        sw $t0,  REQUEST_PUZZLE

        li $a0,  116
        li $a1,  116

        jal move_direct
        

wait_1:
        lw  $t0, VELOCITY
        bne $t0, $0, wait_1


while_not_done:
        jal go_to_next_kernel

        la  $t0, has_puzzle
        lb  $t0, 0($t0)
        bne $t0, $0, solve_puzzle

        j   wait_2

solve_puzzle:
        la      $a0, puzzle
        la      $a1, puzzle_heap
        jal     slow_solve_dominosa 
        la      $a0, puzzle_heap
        sw      $a0, SUBMIT_SOLUTION
        la      $t0, has_puzzle
        sb      $0, 0($t0)
        la      $t0, num_coins
        lw      $t1, 0($t0)
        add     $t1,  $t1,  1
        sw      $t1, 0($t0)

wait_2:
        add $t1, $t1,  1              # t1 = Cycle counter
        blt $t1, 1000,  check_coins

        la  $t0, num_coins
        lw  $t0, 0($t0)
        ble $t0, 2, check_coins

        #  Deploy bot
        la  $t0, map_heap
        sw  $t0, GET_MAP

       li   $t2, 0
scan_map:
       bge  $t2, 1600, done_scanning
       add  $t3, $t0,  $t2
       lb   $t3, 0($t3)
       bne  $t3, 3, end_scan_map
 
       # Spawn minibot
       li   $t4, 1
       sw   $t4, SPAWN_MINIBOT
       la   $t5, num_coins
       lw   $t6, 0($t5)
       sub  $t6, $t6, 2
       sw   $t6, 0($t5) 

       # Set minibot coords
       div  $t3,  $t2,  40   # t3 = Y coordinate
       rem  $t4,  $t2,  40   # t4 = X coordinate
       sw   $0,   SELECT_IDLE_MINIBOTS
       sll  $t4,  $t4,  4
       or   $t4,  $t4,  $t3
       sw   $t4,  SET_TARGET_TILE

       j    done_scanning

end_scan_map:
       add  $t2, $t2, 1

done_scanning:
        li  $t1,  0



check_coins:
        la  $t0, num_coins
        lw  $t0, 0($t0)
        bge $t0, 2, wait_2_2


        # Request new puzzle
        # TODO: Solve puzzle here
        la $t0,  puzzle
        sw $t0,  REQUEST_PUZZLE

wait_2_2:
        lw  $t0, VELOCITY
        bne $t0, $0, wait_2
        li  $t1, 0
        j   while_not_done

        lw $ra 0($sp)
        add $sp, $sp, 4

        j infinite

        jr $ra



