move_direct:
        sub     $sp,   $sp,   12
        sw      $s0,   0($sp)
        sw      $s1,   4($sp)
        sw      $ra,   8($sp)

        sw $0,  ANGLE
        li $t0, 1
        sw $t0, ANGLE_CONTROL

        lw      $s0,   BOT_X
        sub     $s0,   $s0,   $a0       # s0 = curx - x

        lw      $s1,   BOT_Y
        sub     $s1,   $s1,   $a1       # s1 = cury - y

        move    $a0,   $s0
        jal     abs_val
        move    $a1,   $v0

        move    $a0,   $s1
        jal     abs_val
        move    $a0,   $v0

        add     $a2,   $a0,  $a1
        ble     $a2,   4,    finish_moving

        jal     atan                    # v0 = atan

if_quad_1:
        bgt     $s0,   $0,    if_quad_2
        blt     $s1,   $0,    if_quad_2
        mul     $v0,   $v0,   -1
