        mul     $a0,   $a0,   -1
end_abs:
        move    $v0,   $a0
        jr      $ra

# Find the diagonal of a triangle
pythag:
        mul     $a0,   $a0,   $a0
        mul     $a1,   $a1,   $a1
        add     $v0,   $a1,   $a0

        bne     $v0,   $zero, find_root
        bne     $v0,   1,     find_root
        jr      $ra

find_root:
        li      $a0,   1                             # i = 1
        li      $a1,   1                             # result = 1

while:
        bgt     $a1,   $v0,   done_py

        add     $a0,   $a0,   1
        mul     $a1,   $a0,   $a0

        j while

done_py:
        sub     $v0,   $a0,   1
        jr      $ra

# a0: Abs change in y
# a1: Abs change in x
atan:
        la      $v0,   board_width
        la      $t0,   atan_table
        lw      $v0,   0($v0)           # v0 = board_width
        add     $v0,   $v0,   1
        mul     $a0,   $a0,   $v0       # a0 = y * board_width
        add     $a0,   $a0,   $a1       # a0 = y * board_width + x
        mul     $a0,   $a0,   4
        add     $a0,   $a0,   $t0
        lw      $v0,   0($a0) 
        jr      $ra

