        lw      $s0,  BOT_X             # s0 = best x
        lw      $s1,  BOT_Y             # s1 = best y
        li      $s2,  900000            # s2 = best distance

search_map_outer:
        li      $t0,  14                # Lower x bound inclusive
        bgt     $t2,  $t3,  end_search

search_map_inner:
        bgt      $t0,  $t1,  end_map_outter 

        mul     $t4,  $t2,  40
        add     $t4,  $t4,  $t0
        add     $t4,  $t4,  4
