        mul     $a0,  $t0,  8
        mul     $a1,  $t2,  8
        lw      $a2,  BOT_X             # s0 = best x
        lw      $a3,  BOT_Y             # s1 = best y
        sub     $a0,  $a0,  $a2
        sub     $a1,  $a1,  $a3
        
        jal     pythag
        bge     $v0,  $s2,  end_map_inner
        ble     $v0,  8,    end_map_inner  # DON'T go for corn within 8 pixels of us. If it's too close, we get issues with scheduling interrupts.
        mul     $s0,  $t0,  8
        mul     $s1,  $t2,  8
        add     $s0,  $s0,  4
        add     $s1,  $s1,  4
        move    $s2,  $v0

end_map_inner:
